<?php


namespace Sowren\Wormhole\Test\Feature;

use Illuminate\Http\UploadedFile;
use Sowren\Wormhole\Test\TestCase;
use Sowren\Wormhole\Facades\Wormhole;
use Illuminate\Support\Facades\Storage;

class FileUploadTest extends TestCase
{
    public function clearStorage()
    {
        if (Storage::disk('public')->exists('avatars')) {
            Storage::disk('public')->deleteDirectory('avatars');
        }
    }

    /** @test */
    public function testFileUpload()
    {
        $file = UploadedFile::fake()->image('avatar.png');
        $filename = Wormhole::saveFile($file, 'avatars');
        Storage::disk('public')->assertExists('avatars/'.$filename);
        $this->clearStorage();
    }

    /** @test */
    public function testbase64FileUpload()
    {
        $this->clearStorage();
        $data = "data:image/png;base64,";
        $filename = Wormhole::saveBase64File($data, 'avatars');
        Storage::disk('public')->assertExists('avatars/'.$filename);
        $this->clearStorage();
    }
}
